(1, '<aside id=\"media_image-4\" class=\"content well push-bottom-large widget widget_media_image\">\r\n	<!-- Widget 1 -->\r\n	<a href=\"http://dubai4dpools.com/policy\" target=\"_blank\" rel=\"noopener nofollow\"><img width=\"100%\" height=\"auto\" src=\"http://dubai4dpools.com/wp-content/uploads/lottery-banner-1.jpg\" class=\"image wp-image-149  attachment-full size-full\" alt=\"\" />\r\n	<!-- End Widget 1 -->\r\n</aside>\r\n<aside id=\"media_image-3\" class=\"content well push-bottom-large widget widget_media_image\">\r\n	<!-- Widget 2 -->\r\n	<a href=\"https://www.dubaiparksandresorts.com/en\" target=\"_blank\" rel=\"noopener nofollow\"><img width=\"100%\" height=\"auto\" src=\"http://dubai4dpools.com/wp-content/uploads/img-worav-banner-opt.gif\" class=\"image wp-image-145  attachment-full size-full\" alt=\"\"/>\r\n	<!-- End Widget 2 -->\r\n</aside>\r\n', '<div class=\"brown-box txt-center\">\r\n							 Dubai 4D Pools<br>Department Contact\r\n						</div>\r\n						<div class=\"phn-nbr\">\r\n							+971 4 366 1688\r\n						</div>\r\n						<div class=\"phn-title\">\r\n							Call Guidance\r\n						</div>\r\n						<div class=\"aside-excerpt-phn\">\r\n							<ul>\r\n								<li>Inquiries on the address and business hours of the lottery department</li>\r\n								<li>Opinions and requests on lottery tickets</li>\r\n							</ul>\r\n						</div>\r\n						<div class=\"yellow-box txt-center\">\r\n							Call number guidance by telephone\r\n						</div>\r\n						<div class=\"aside-excerpt\">\r\n							<ul>\r\n								<li>Telephone service\r\n								</li>\r\n							</ul>\r\n						</div>', '0000-00-00 00:00:00');
INSERT INTO `siteinfo` (`siteinfo_id`, `siteinfo_title`, `siteinfo_desc`, `siteinfo_keyword`, `siteinfo_favicon`, `siteinfo_logo`, `siteinfo_logo_bank`, `siteinfo_namepools`, `siteinfo_heading`, `siteinfo_how_to`, `siteinfo_notice`, `siteinfo_footer`, `siteinfo_analitics`, `siteinfo_verification`, `createdate`) VALUES
(1, 'Live Draw Dubai 4D Pools | تجمع دبي اليوم - احصل على رقم الحظ الخاص بك', 'Dubai Pools 4D Lottery presents the fairplay live draw on Dubai 4D Pools Official Site. Watch the live draw of 4D Pools Lottery Result that draws every day...', 'Dubai4DPools, Dubai 4D Pools, Dubai Pools 4D, Dubai Lottery 4D, Dubai 4D Lottery, Togel Dubai, Dubai Official 4D Pools Lottery, Live Draw Dubai 4D Pools', 'wp-content/uploads/favicon.png', 'wp-content/uploads/logo.png', 'wp-content/uploads/banks-eligible.jpg', 'DbPools', '<img class=\"alignnone size-full wp-image-161\" style=\"width: auto; height: 25px;\" src=\"http://dubai4dpools.com/wp-content/uploads/dbpools.png\" /></h5> 							<div class=\"excerpt-block\">is the Finest Lottery Pools in Dubai which operated since 2010 by the Millennium Millionaire which offers a one-in-10,000 chance to win a Grand Jackpot worth US$1 million. Available throughout all over the world, Dubai 4D Pools has already created more than 150.000 winners.</div>', '<li class=\"htp-img\"><img src=\"wp-content/uploads/how-to-purchase-1.jpg\" alt=\"\"></li>\r\n<li class=\"htp-img\"><img src=\"wp-content/uploads/how-to-purchase-2.jpg\" alt=\"\"></li>\r\n<li class=\"htp-img\"><img src=\"wp-content/uploads/how-to-purchase-3.jpg\" alt=\"\"></li>\r\n<li class=\"htp-img\"><img src=\"wp-content/uploads/how-to-purchase-4.jpg\" alt=\"\"></li>', '<li>\r\n	Dubai Islamic Bank only receive inquiry from WhatsApp, lottery ticket winning number can now be made from https://www.dibpak.com\r\n	<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n	يتلقى بنك دبي الإسلامي فقط طلبًا من WhatsApp ، ويمكن الآن الحصول على رقم الفوز بتذكرة يانصيب من https://www.dibpak.com\r\n	</span>\r\n</li>\r\n<li>\r\n	Please be aware of the “fraud” over lottery aging ticket payment.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		يرجى أن تكون على علم “الاحتيال” على دفع تذكرة اليانصيب الشيخوخة.\r\n	</span>\r\n</li>\r\n<li>\r\n	One touch access from virtual account to lottery service! is now available for Abu Dhabi Commercial Bank Customer.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		الوصول بلمسة واحدة من الحساب الافتراضي إلى خدمة اليانصيب! متاح الآن لعملاء بنك أبوظبي التجاري.\r\n	</span>\r\n</li>\r\n<li>\r\n	[ Important! ] Attention to the phishing lottery notification e-mail and the cash payment guidance of winning money.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		مهم! ] الانتباه إلى البريد الإلكتروني إشعار اليانصيب الخداع وإرشادات الدفع النقدي للفوز بالمال ]\r\n	</span>\r\n</li>\r\n<li>\r\n	Release on Friday, September 21 at each prizes of “Dubai World Cup”, “PSA Dubai World Series Final”, “Dubai Summer Surprises” and “Eid Al Adha”.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		إطلاق يوم الجمعة 21 سبتمبر في كل من جوائز “كأس دبي العالمي” و “بطولة دبي العالمية لسلسلة النهائي” و “مفاجآت صيف دبي” و “عيد الأضحى.\r\n	</span>\r\n</li>\r\n<li>\r\n	Notice of constant renewal of each partners Bank on Dubai 4D Pools.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		إخطار بالتجديد المستمر لكل شريك بنك على مجمعات دبي اليوم.\r\n	</span>\r\n</li>\r\n<li>\r\n	Worldwide Lottery Agents of Dubai 4D Pools are available during National UAE Days.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		وكلاء اليانصيب في جميع أنحاء العالم من حمامات دبي متوفرة خلال أيام الإمارات الوطنية.\r\n	</span>\r\n</li>\r\n<li>\r\n	About the handling of personal information when using this website is governed in privacy policy.<br />\r\n	<span class=&quot;yellow-arabic&quot;>\r\n		حول التعامل مع المعلومات الشخصية عند استخدام هذا الموقع محكوم بسياسة الخصوصية.\r\n	</span>\r\n</li>', '<p><a href=&quot;http://dubai4dpools.com&quot; target=&quot;_blank&quot; rel=&quot;noreferrer noopener&quot;> Dubai 4D Pools Lottery</a> Limited, of Burj Khalifa, Sheikh Mohamed Bin Rashid Boulevard, Downtown Dubai, Dubai, United Arab Emirates, is licensed by the Government Of Finance at UAE and regulated by the UAE Lotto Commissioner under the UAE Gambling Act 2010 (Licences: <strong>RGL 085 & 066</strong>), and is licensed and regulated by the Lottery Commission of UAE for customers in UAE (Licence: <strong>000-038991-R-319408-005</strong>). UAE Lotto Limited has a Remote Bookmaker&#39;s Licence issued by the UAE National Excise Licence Office (Reference Number 1011284) for lotto buying activities in East Asia.</p>\r\n<p>This website is operated by Dubai 4D Pools. Dubai 4D Pools has several Official Agents throughout Asia acting as a bookmaker. When buying tickets, Agent acts in the name and on behalf of the Player.</p>\r\n<p>Persons under 18 years of age are not permitted to buy lottery.</p>\r\n <p>This is a real money lottery site. Please use it responsibly and only buy what you can afford. For symptom of addiction help and support, please contact Dubai Aware at <span class=&quot;blue-arabic&quot;>+971 4 366 1688</span> or visit <span class=&quot;blue-arabic&quot;>http://dubai4dpools.com/</span></p>\r\n <p>Dubai 4D Pools - The biggest East Asia and international lotteries at <span class=&quot;blue-arabic&quot;><strong>dubai4dpools.com</strong></span></p>\r\n <p><span class=&quot;blue-arabic&quot;><strong>Copyright 2010 dubai4dpools.com All Rights Reserved.</strong></span></p>', 'UA-126270769-2', '<meta name=\"google-site-verification\" content=\"2KJMMKdB5lby7o58QSY1g8vixSPCrmzkZZVCbclmd7w\" />\r\n', '2019-03-31 06:56:27');
